import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <nav className="navbar navbar-light bg-dark m-2">
        <span className="navbar-brand mb-0 h1">Navbar</span>
      </nav>
    );
  }
}

export default Navbar;
